let searchString = '[ds6w:identifier]:"prd*"'

let top = msg.top
let skip = msg.skip
let mask = "dsmveng:EngItemMask.Details"


let url = msg.searchEngitemUrl + "?$top=" + msg.top + "&$skip=" + msg.skip + "&$searchStr=" + searchString + "&$mask="+ mask


msg.payload = {
    url: url
}
return msg;

msg.payload = msg.payload.member
msg.loop = msg.loop + 1
msg.skip = msg.loop * msg.top


let length = msg.payload.length
msg.searchResults.push(...msg.payload);


if (msg.top == msg.payload.length) {
    // loop finished → output 2
    return [null, msg];
} else {
    // continue → output 1
    msg.payload = msg.searchResults
    delete msg.searchResults
    delete msg.top
    delete msg.skip
    delete msg.loop
    delete msg.topic
    delete msg.statusCode
    delete msg._event
    return [msg, null];
}

// Ensure msg.payload is an array (input)
if (!Array.isArray(msg.payload)) {
    msg.payload = [];
}

// If msg.components does not exist yet, copy from msg.payload (only once)
if (!Array.isArray(msg.components) || msg.components.length === 0) {
    msg.components = Array.isArray(msg.payload) ? msg.payload : [];
}

// Ensure msg.componentsData exists as an empty array only if not already defined
if (!Array.isArray(msg.componentsData)) {
    msg.componentsData = [];
}

// Base array for chunking
const items = Array.isArray(msg.components) ? msg.components : [];

// Constant chunk size
const CHUNK_SIZE = 100;

// Initialize chunk control variables only once
if (typeof msg.chunkStep !== 'number') {
    msg.chunkStep = CHUNK_SIZE;                       // chunk size
}
if (typeof msg.chunkTotal !== 'number') {
    msg.chunkTotal = items.length > 0
        ? Math.ceil(items.length / msg.chunkStep)     // total number of chunks
        : 0;
}

// Update loop counter (1-based)
if (typeof msg.loop === 'number') {
    msg.loop = msg.loop + 1;  // next loop
} else {
    msg.loop = 1;             // first loop
}

// Calculate slice range for this loop
const start = (msg.loop - 1) * msg.chunkStep;
const end = start + msg.chunkStep;

// Slice current chunk into msg.payload
msg.payload = items.slice(start, end);

// Optional: flag to indicate if there are no more chunks
msg.isLastChunk = (msg.loop >= msg.chunkTotal) || (start >= items.length);

return msg;

// Adiciona cada item do chunk atual em msg.components
msg.payload.forEach(el => {
    msg.componentsData.push(el);
});

if (msg.loop !== msg.chunkTotal) {
    return [null, msg]; // Saída 2
} else {
    msg.payload = msg.componentsData
    delete msg.componentsData
    delete msg.top
    delete msg.object
    delete msg.topic
    delete msg.loop
    delete msg.chunkTotal
    delete msg.chunkStep
    delete msg.pp
    delete msg.id
    delete msg.url
    delete msg._event
    delete msg.components
    return [msg, null]; // Saída 1
}

const prefix = msg.engPrefix || "";

msg.payload = msg.payload.map(item => {
    if (item && typeof item === "object" && item.id) {
        item.relativePath = prefix + item.id;
    }
    return item;
});

return msg;
